import ListItems from "./ListItems";

function MainComponent(props){
    return (
        <div>
            <OuterBox/>
            {/* <ListItems text = {props.item[0]}/>
            <ListItems text = {props.item[1]}/> */}

            <ul>
            {
                props.item.map((todo)=>{
                    return <ListItems text = {todo}/>
                })
            }
            </ul>
        </div>
    );

}

export default MainComponent;
